import React, { Fragment, lazy, Suspense } from 'react';
import { ThemeProvider } from '@mui/material/styles';
import { theme } from './Config/theme';

const Routes = lazy(() => import('./Routes'));

const App = () => {
  return (
    <ThemeProvider theme={theme}>
      <Routes/>
    </ThemeProvider>
  )
}

export default App;
